import {makeAutoObservable} from "mobx";

export default class DeviceStore {
    constructor() {
        this._types = []
        this._brands = []
        this._devices = []
        makeAutoObservable(this)
    }

    setTypes(types) {
        this._types = types
    }
    setUser(brands) {
        this._brands = brands
    }
    setDevices(devices) {
        this._devices = devices
    }

    get (){
        return this._isAuth
    }
    get user() {
        return this._user
    }
}
